  return (
    <div className="Tracker">
      <TrackerSearch onDataFetch={setApiData} />
      {apiData && (
        <div>{JSON.stringify(apiData.gameName)}
        JSON.stringify(apiData.gameName)}</div>
      )}
    </div >
  );
}

